import React from 'react';
import { useStarWarsContext } from './Context/StarWarsContext';

const TablePlanets = () => {
  const {getPlanetsStarWars} = useStarWarsContext;
  const {
    name,
    rotation_period,
    orbital_period,
    diameter,
    gravity,
    terrain,
    surface_water,
    population,
    residents,
    films,
    created,
    edited,
    url, } = getPlanetsStarWars();
  const names = 'felipe';
  return (
    <table>
      <thead>
        <th>anada</th>
        <tr>{names}</tr>
        <td>dsd</td>
      </thead>
      <tr>test</tr>
      <td>planets</td>
      <tr>somando</tr>
    </table>
  );
};

export default TablePlanets;
